import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';
import Background from './background.jpg';
import Register from './register';
import NavBar from './navbar';
import Home from './home'

class NewSX extends React.Component {

    handleClick() {
        console.log('Click happened');
    }

    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } alt="" />
                <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                <br></br>
                <div onClick={this.handleClick()} className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2">
                        <button onClick={this.handleClick()} type="button" className="home-button btn btn-primary btn-lg">Ny melding</button>;
                    </div>
                    <div className="p-2">
                        <button type="button" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                    </div>
                </div>
               /* <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <Home />
                </div>*/
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <NewSX />,
    document.getElementById('root')
);
